import { useState, useEffect } from "react";
import api from "../api";
import NewActivityForm from "./NewActivityForm";

export default function Calendar({ usuarioIdSeleccionado }) {
  const [actividades, setActividades] = useState([]);
  const [fechaActual, setFechaActual] = useState(new Date());
  const [actividadSeleccionada, setActividadSeleccionada] = useState(null);
  const [mostrarFormulario, setMostrarFormulario] = useState(false);

  useEffect(() => {
    const fetchActividades = async () => {
      try {
        const token = localStorage.getItem("accessToken");
        const res = await api.get("/actividades/", {
          headers: { Authorization: `Bearer ${token}` },
        });

        const actividadesFiltradas = res.data.filter(
          (a) => !usuarioIdSeleccionado || a.usuario_responsable?.id === usuarioIdSeleccionado
        );

        setActividades(actividadesFiltradas);
      } catch (err) {
        console.error("Error cargando actividades:", err);
      }
    };

    fetchActividades();
  }, [usuarioIdSeleccionado, mostrarFormulario]);

  const abrirFormularioParaEditar = (actividad) => {
    setActividadSeleccionada(actividad);
    setMostrarFormulario(true);
  };

  const cerrarFormulario = () => {
    setActividadSeleccionada(null);
    setMostrarFormulario(false);
  };

  const handleActividadGuardada = () => {
    cerrarFormulario();
  };

  const generarDiasDelMes = () => {
    const inicioMes = new Date(fechaActual.getFullYear(), fechaActual.getMonth(), 1);
    const finMes = new Date(fechaActual.getFullYear(), fechaActual.getMonth() + 1, 0);
    const dias = [];

    for (let d = 1; d <= finMes.getDate(); d++) {
      dias.push(new Date(fechaActual.getFullYear(), fechaActual.getMonth(), d));
    }

    return dias;
  };

  const cambiarMes = (incremento) => {
    const nuevoMes = new Date(
      fechaActual.getFullYear(),
      fechaActual.getMonth() + incremento,
      1
    );
    setFechaActual(nuevoMes);
  };

  const formatearFecha = (fecha) =>
    fecha.toLocaleDateString("es-ES", { month: "long", year: "numeric" });

  return (
    <div className="p-4">
      <div className="flex justify-between items-center mb-4">
        <button
          className="px-3 py-1 bg-gray-200 rounded hover:bg-gray-300"
          onClick={() => cambiarMes(-1)}
        >
          ← Mes anterior
        </button>
        <h2 className="text-xl font-semibold">{formatearFecha(fechaActual)}</h2>
        <button
          className="px-3 py-1 bg-gray-200 rounded hover:bg-gray-300"
          onClick={() => cambiarMes(1)}
        >
          Mes siguiente →
        </button>
      </div>

      <div className="grid grid-cols-7 gap-2 text-sm">
        {["Lun", "Mar", "Mié", "Jue", "Vie", "Sáb", "Dom"].map((dia) => (
          <div key={dia} className="text-center font-semibold border-b pb-1">
            {dia}
          </div>
        ))}

        {generarDiasDelMes().map((dia) => {
          const actividadesDelDia = actividades.filter((a) => {
            const fechaActividad = new Date(a.fecha_inicio);
            return (
              fechaActividad.getDate() === dia.getDate() &&
              fechaActividad.getMonth() === dia.getMonth() &&
              fechaActividad.getFullYear() === dia.getFullYear()
            );
          });

          return (
            <div
              key={dia.toISOString()}
              className="border h-32 overflow-y-auto p-1 rounded hover:bg-gray-50"
            >
              <div className="font-medium text-xs mb-1 text-gray-700">
                {dia.getDate()}
              </div>

              {actividadesDelDia.map((a) => (
                <div
                  key={a.id}
                  className="bg-blue-100 text-xs p-1 mb-1 rounded cursor-pointer hover:bg-blue-200"
                  onClick={() => abrirFormularioParaEditar(a)}
                  title={a.descripcion_publica}
                >
                  {a.tipo} — {a.descripcion_publica?.slice(0, 30)}...
                </div>
              ))}
            </div>
          );
        })}
      </div>

      {mostrarFormulario && (
        <NewActivityForm
          actividad={actividadSeleccionada}
          onCancel={cerrarFormulario}
          onCreated={handleActividadGuardada}
        />
      )}
    </div>
  );
}
